/*Constructor*/		Win32GDI::Win32GDI()
{
	hBitmap = NULL;
	hMemDC = NULL;
	HWND		hDesktop = GetDesktopWindow();
	HDC			hdcDesktop = GetWindowDC(hDesktop);
	if (hdcDesktop != NULL)
	{
		GetWindowRect(hDesktop, &rectDesktop);
		hMemDC = CreateCompatibleDC(hdcDesktop);
		if (hMemDC != NULL)
		{
			hBitmap = CreateCompatibleBitmap(hdcDesktop, rectDesktop.right, rectDesktop.bottom);
			if (hBitmap != NULL)
			{
				SelectObject(hMemDC, hBitmap);
			}
			else
			{
				DeleteDC(hMemDC);
				hMemDC = NULL;
			}
		}
		ReleaseDC(hDesktop, hdcDesktop);
	}
}
void				Win32GDI::CaptureDesktop(void)
{
	HWND		hDesktop = GetDesktopWindow();
	HDC			hdcDesktop = GetWindowDC(hDesktop);
	BitBlt(hMemDC, 0, 0, rectDesktop.right, rectDesktop.bottom, hdcDesktop, 0, 0, SRCCOPY);
	ReleaseDC(hDesktop, hdcDesktop);
}
int					Win32GDI::GetPixel(int x, int y)
{
	if (hMemDC != NULL)
	{
		int color = 0;
		color = ::GetPixel(hMemDC, x, y);
		return color;
	}
	return 0;
}
bool				Win32GDI::ValidMode(void)
{
	HWND	d3Wnd = FindWindowW(L"D3 Main Window Class", L"Diablo III");
	RECT	d3rect;
	GetClientRect(d3Wnd, &d3rect);

	return (hMemDC != NULL
		&& d3rect.top == 0
		&& d3rect.left == 0
		&& d3rect.right == 1920
		&& d3rect.bottom == 1080
		&& rectDesktop.top == 0
		&& rectDesktop.left == 0
		&& rectDesktop.right == 1920
		&& rectDesktop.bottom == 1080
		);
}
/*Desstructor*/		Win32GDI::~Win32GDI()
{
	if (hBitmap != NULL) DeleteObject(hBitmap);
	if (hMemDC != NULL) DeleteDC(hMemDC);
}




